The two methods, DrawBunny and DrawBunny2, are very similar. What are the differences?

The method names
The character used for the eyes

Instead of writing these two methods that are almost identical, it is possible to use method parameters to make the one method a little more dynamic. Method parameters allow developers to pass information to methods when they are called, so they can do different things depending on that information.
For this program, the eye is what will change with different method calls. The eye could be any piece of text at all, so the code in the body of the DrawBunnyEye method should not draw any eyes directly! Instead, it should insert the eye into the text dynamically.

Under the existing method definitions, define a new method named DrawBunnyEye
